import React from 'react'
import Index from './components/Index.js'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';


const App = () => {
  return (
    <Router>
      <Index />
      <Routes>
        <Route path='/' />
      </Routes>
    </Router>
  )
}

export default App
